import React, { Component } from 'react';
import { connect } from 'react-redux';
import  DataState  from './Data';
import BlankState from './BlankState';
import ErrorState from './Error';
class BooksRecord extends Component {
    render() {
        return (<div>
            <table className="BookRecord">
                <thead>
                    <tr>
                        <td>Sr No</td>
                        <td>Book Title</td>
                        <td>Cover</td>
                        <td>Author</td>
                        <td>Publisher</td>
                        <td>Action</td>
                    </tr>
                </thead>
                <tbody>             
                    
                    <DataState />
                   {/* / <ErrorState/> */}
                </tbody>
            </table>
        </div>);
    }
}
export default connect()(BooksRecord);
